import React from "react";
function Orb() {


    const mystyle = {
      width : "70vh"   , 
      height : "70vh" ,
      position : "absolute" ,
      borderRadius : "50%" , 
      marginLeft : "-37vh" ,
      marginTop : "-37vh" , 
      background  : "linear-gradient(180deg , #f56692 0% , #f2994a 100%)" ,
      filter : "blur(400px)" ,

    }
    return(
        <div style ={mystyle}>orb</div>
    )
}


export default Orb ;
